// SPDX-License-Identifier: MIT

pragma solidity 0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";

contract MyProfile is Ownable {
    enum PostStatus {
        DRAFT,
        PUBLISHED,
        ARCHIVED
    }

    struct Post {
        PostStatus status;
        string cid;
        string slug;
        uint64 created;
        // the index where post is placed in published posts list
        uint index;
    }

    struct PostsList {
        string[] list;
        uint length;
    }

    // postCID => Post
    mapping(string => Post) private cidToPost;
    // slug => postCID
    mapping(string => string) private slugToPostCid;

    PostsList private draftPosts;
    PostsList private publishedPosts;
    PostsList private archivedPosts;

    receive() external payable {}

    function createDraftPost(
        string memory _postCid,
        string memory _slug,
        uint64 _created
    ) public onlyOwner {
        require(_created > 0, "created time should be > 0");
        require(bytes(_slug).length > 0, "slug cannot be empty");
        require(cidToPost[_postCid].created == 0, "the post with passed CID is already present");
        require(bytes(slugToPostCid[_slug]).length == 0, "slug should be unique");

        cidToPost[_postCid] = Post({
            status: PostStatus.DRAFT,
            cid: _postCid,
            slug: _slug,
            created: _created,
            index: draftPosts.list.length
        });

        slugToPostCid[_slug] = _postCid;

        draftPosts.list.push(_postCid);
        draftPosts.length++;
    }

    function publishPost(string memory _postCid) public onlyOwner {
        require(
            cidToPost[_postCid].status != PostStatus.PUBLISHED,
            "the post is already published"
        );

        if (cidToPost[_postCid].status == PostStatus.DRAFT) {
            delete draftPosts.list[cidToPost[_postCid].index];
            draftPosts.length--;
            //
        } else if (cidToPost[_postCid].status == PostStatus.ARCHIVED) {
            delete archivedPosts.list[cidToPost[_postCid].index];
            archivedPosts.length--;
        }

        cidToPost[_postCid].status = PostStatus.PUBLISHED;
        cidToPost[_postCid].index = publishedPosts.list.length;

        publishedPosts.list.push(_postCid);
        publishedPosts.length++;
    }

    function archivePost(string memory _postCid) public onlyOwner {
        require(
            cidToPost[_postCid].status == PostStatus.PUBLISHED,
            "the post should be published to archive"
        );

        delete publishedPosts.list[cidToPost[_postCid].index];
        publishedPosts.length--;

        cidToPost[_postCid].status = PostStatus.ARCHIVED;
        cidToPost[_postCid].index = archivedPosts.list.length;

        archivedPosts.list.push(_postCid);
        archivedPosts.length++;
    }

    /*
    Replace post CID with new CID

    Restrictions:
    - A post should be in DRAFT or PUBLISHED status
    - A post cannot be ARCHIVED
    */
    function updatePost(
        string memory _oldPostCid,
        string memory _newPostCid,
        string memory _slug
    ) public onlyOwner {
        require(
            cidToPost[_oldPostCid].status != PostStatus.ARCHIVED,
            "the post should not be archived"
        );

        // copy old post data to new (updated) post
        cidToPost[_newPostCid] = cidToPost[_oldPostCid];
        cidToPost[_newPostCid].cid = _newPostCid;

        delete slugToPostCid[cidToPost[_oldPostCid].slug];
        cidToPost[_newPostCid].slug = _slug;
        slugToPostCid[_slug] = _newPostCid;

        if (cidToPost[_newPostCid].status == PostStatus.DRAFT) {
            // replace old post CID with new CID
            draftPosts.list[cidToPost[_newPostCid].index] = _newPostCid;
            //
        } else if (cidToPost[_newPostCid].status == PostStatus.PUBLISHED) {
            publishedPosts.list[cidToPost[_newPostCid].index] = _newPostCid;
        }

        // remove old post data
        delete cidToPost[_oldPostCid];
    }

    function getPost(string memory _postCid) public view returns (Post memory) {
        return cidToPost[_postCid];
    }

    function getPostBySlug(string memory _slug) public view returns (Post memory) {
        return cidToPost[slugToPostCid[_slug]];
    }

    function getDraftPosts(uint _start, uint _end) public view returns (Post[] memory, uint) {
        require(_end - _start <= 50, "different between _end and _start cannot be > 50");

        return (_paginate(draftPosts.list, _start, _end), draftPosts.length);
    }

    function getPublishedPosts(uint _start, uint _end) public view returns (Post[] memory, uint) {
        require(_end - _start <= 50, "different between _end and _start cannot be > 50");

        return (_paginate(publishedPosts.list, _start, _end), publishedPosts.length);
    }

    function getArchivedPosts(uint _start, uint _end) public view returns (Post[] memory, uint) {
        require(_end - _start <= 50, "different between _end and _start cannot be > 50");

        return (_paginate(archivedPosts.list, _start, _end), archivedPosts.length);
    }

    function withdraw() public onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function _paginate(
        string[] memory self,
        uint _start,
        uint _end
    ) public view returns (Post[] memory) {
        require(_start >= 0 && _start < _end, "_start should be >= 0 and < _end");

        uint _totalNumber = self.length;
        uint _allowableEnd;

        if (_end > _totalNumber) {
            _allowableEnd = _totalNumber;
        } else {
            _allowableEnd = _end;
        }

        Post[] memory _list;

        if (_allowableEnd <= _start) {
            _list = new Post[](0);

            return _list;
        }

        uint _currentNumber = _allowableEnd - _start;
        uint _startOffset = _totalNumber - 1 - _start;

        _list = new Post[](_currentNumber);

        uint n = 0;
        uint index = _startOffset;

        while (n < _currentNumber) {
            // check that it's not removed
            if (bytes(self[index]).length != 0) {
                _list[n] = cidToPost[self[index]];
                n++;
            }
            if (index == 0) {
                break;
            }
            index--;
        }

        return _list;
    }
}
